import React from 'react';

function Main({ currentUser }) {
    return (
        <div className="text-center">
            {currentUser ? (
                <h2 className="text-2xl font-bold">'{currentUser.memberName}'님, 환영합니다.</h2>
            ) : (
                <h2 className="text-2xl font-bold">LungMate에 오신 것을 환영합니다.</h2>
            )}
            <p className="mt-4 text-lg text-gray-400">메뉴를 선택하여 진단을 시작하세요.</p>
        </div>
    );
}

export default Main;
